#!/usr/bin/env python3

import struct
import pandas as pd
import numpy as np

def parse_tof_binary_data(binary_data_str):
    """
    Parse TOF binary data with x, y, z, and Amplitudes fields
    Each record is 16 bytes: 4 bytes per field (float32)
    """
    
    # Clean the binary string - remove b' prefix and ' suffix if present
    if binary_data_str.startswith("b'") and binary_data_str.endswith("'"):
        binary_data_str = binary_data_str[2:-1]
    
    # Convert escaped byte string to actual bytes
    try:
        # Handle the escaped byte sequences
        binary_data = binary_data_str.encode('utf-8').decode('unicode_escape').encode('latin1')
    except:
        # Alternative parsing if the above fails
        binary_data = bytes.fromhex(binary_data_str.replace('\\x', ''))
    
    # Each record is 16 bytes (4 fields Ã— 4 bytes each)
    record_size = 16
    num_records = len(binary_data) // record_size
    
    print(f"Binary data length: {len(binary_data)} bytes")
    print(f"Number of records: {num_records}")
    
    # Parse the data
    x_data = []
    y_data = []
    z_data = []
    amplitudes = []
    
    for i in range(num_records):
        offset = i * record_size
        
        if offset + record_size <= len(binary_data):
            # Unpack as little-endian float32 values
            try:
                x = struct.unpack('<f', binary_data[offset:offset+4])[0]
                y = struct.unpack('<f', binary_data[offset+4:offset+8])[0] 
                z = struct.unpack('<f', binary_data[offset+8:offset+12])[0]
                amp = struct.unpack('<f', binary_data[offset+12:offset+16])[0]
                
                x_data.append(x)
                y_data.append(y)
                z_data.append(z)
                amplitudes.append(amp)
                
            except struct.error as e:
                print(f"Error parsing record {i}: {e}")
                break
    
    # Create DataFrame
    df = pd.DataFrame({
        'x': x_data,
        'y': y_data, 
        'z': z_data,
        'Amplitudes': amplitudes
    })
    
    return df

def process_tof_file_with_binary_data(binary_data_str):
    """
    Process the TOF data and apply your original filtering logic
    """
    # Parse the binary data
    tof_data = parse_tof_binary_data(binary_data_str)
    
    if tof_data is not None and not tof_data.empty:
        print(f"Successfully parsed {len(tof_data)} data points")
        print("\nData preview:")
        print(tof_data.head(10))
        
        print(f"\nData ranges:")
        print(f"X: {tof_data['x'].min():.6f} to {tof_data['x'].max():.6f}")
        print(f"Y: {tof_data['y'].min():.6f} to {tof_data['y'].max():.6f}")
        print(f"Z: {tof_data['z'].min():.6f} to {tof_data['z'].max():.6f}")
        print(f"Amplitudes: {tof_data['Amplitudes'].min():.6f} to {tof_data['Amplitudes'].max():.6f}")
        
        # Apply your original processing logic
        try:
            # Find b_scan_pos (minimum x value >= 0.4)
            x_filtered = tof_data['x'][tof_data['x'] >= 0.4]
            if not x_filtered.empty:
                b_scan_pos = x_filtered.min()
                print(f"\nb_scan_pos: {b_scan_pos}")
            else:
                print("\nNo x values >= 0.4 found")
                b_scan_pos = None
            
            # Filter data where x < 1.1
            mask = tof_data['x'] < 1.1
            X = tof_data['x'][mask]
            Y = tof_data['y'][mask]
            Z = tof_data['z'][mask]
            
            print(f"Filtered data points (x < 1.1): {len(X)}")
            
            return tof_data, X, Y, Z, b_scan_pos
            
        except Exception as e:
            print(f"Error in processing: {e}")
            return tof_data, None, None, None, None
    else:
        print("Failed to parse binary data")
        return None, None, None, None, None


